def calculate_area(length, width):
    try:
        length = float(length)
        width = float(width)
        if length <= 0 or width <= 0:
            raise ValueError("Length and width must be positive numbers.")
        if length == 0 or width == 0:
            raise ValueError("Length and width cannot be zero.") # Added requirement for non-zero values
        if length > 100 or width > 100:
            raise ValueError("Length and width must be less than or equal to 100.") # Added requirement for maximum value
        area = round(length * width, 2)
        return area
    except ValueError:
        raise ValueError("Length and width must be positive numbers.")

